import React from 'react'
import { StyleSheet, View, Text, Button} from 'react-native'
import { getArticles } from '@src/reduxStore/actions'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'


class Account extends React.Component {
    buttonClick = () => {
        this.props.getArticles()
    }

    render() {
        return (
            <View>
                <Button title='Hello' onClick={this.buttonClick}>hello</Button>
                <Text>Account</Text>
                { this.props.articles.map((article) => {
                    <View><Text>{article.title}</Text></View>
                }
                )}
            </View>
        )
    }

}
const styles = StyleSheet.create({
        
})

const mapStateToProps = (state) => ({ articles: state.article.articles })
const mapDispatchToProps = dispatch => { onLoading: () => {dispatch(getArticles())} }

export default connect(mapStateToProps,mapDispatchToProps)(Account)
